import React from 'react';
import { useSelector } from 'react-redux';







export default function ListActivities() {

  const activities = useSelector((state)=> state.activities);  


    

  return (
    <div>
      <h3>ListActivities</h3>
    
    <div>
      {
        activities?.map(act => {
          return (
            <ul>
              <li>
                {act.name}
              </li>
            </ul>
          )
        })
          
      }
    </div>
    
    
    
    
    
    </div>
  )
};
